import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';

const ProfileEdit = () => {
  const navigate = useNavigate();
  const [id, setId] = useState(0); // เพิ่มตัวแปรสำหรับเก็บ ID
  const [formData, setFormData] = useState({
    id: 0,
    newMName: '',
    newMLname: '',
    newUsername: '',
    newPassword: '',
    newDownRate: 0,
    newName: '',
    newAddress: '',
    newCommonMoney: 0
  });

  useEffect(() => {
    // ดึงข้อมูลโปรไฟล์เก่าจาก API และตั้งค่าในฟอร์ม
    axios.get('http://26.90.237.200:3000/admin/read')
      .then(response => {
        const profile = response.data[0];
        setFormData({
          id: profile.id,
          newMName: profile.manager_name,
          newMLname: profile.manager_lastname,
          newUsername: profile.he_username,
          newPassword: profile.he_password,
          newDownRate: profile.down_rate,
          newName: profile.name,
          newAddress: profile.address,
          newCommonMoney: profile.common_money
        });
        console.log(profile.he_id)
      })
      .catch(error => {
        console.error(error);
      });
  }, []);

  const handleInputChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // ส่งคำขอแก้ไขโปรไฟล์ไปยัง API
    axios.patch('http://26.90.237.200:3000/admin/edit', formData)
      .then(response => {
        console.log(response.data);
        navigate('/UserProfile');
      })
      .catch(error => {
        console.error(error);
        navigate('/UserProfile');
      });
  };

  return (
    <div className="container">
      <form onSubmit={handleSubmit}>
      <div className="mb-3">
          <label htmlFor="newMName" className="form-label">ชื่อ</label>
          <input type="text" className="form-control" id="newMName" name="newMName" value={formData.id} onChange={handleInputChange} />
        </div>
        <div className="mb-3">
          <label htmlFor="newMName" className="form-label">ชื่อ</label>
          <input type="text" className="form-control" id="newMName" name="newMName" value={formData.newMName} onChange={handleInputChange} />
        </div>
        <div className="mb-3">
          <label htmlFor="newMLname" className="form-label">นามสกุล</label>
          <input type="text" className="form-control" id="newMLname" name="newMLname" value={formData.newMLname} onChange={handleInputChange} />
        </div>
        <div className="mb-3">
          <label htmlFor="newUsername" className="form-label">ชื่อผู้ใช้</label>
          <input type="text" className="form-control" id="newUsername" name="newUsername" value={formData.newUsername} onChange={handleInputChange} />
        </div>
        <div className="mb-3">
          <label htmlFor="newPassword" className="form-label">รหัสผ่าน</label>
          <input type="password" className="form-control" id="newPassword" name="newPassword" value={formData.newPassword} onChange={handleInputChange} />
        </div>
        <div className="mb-3">
          <label htmlFor="newDownRate" className="form-label">อัตราผ่อน (%)</label>
          <input type="number" className="form-control" id="newDownRate" name="newDownRate" value={formData.newDownRate} onChange={handleInputChange} />
        </div>
        <div className="mb-3">
          <label htmlFor="newName" className="form-label">โครงการ</label>
          <input type="text" className="form-control" id="newName" name="newName" value={formData.newName} onChange={handleInputChange} />
        </div>
        <div className="mb-3">
          <label htmlFor="newAddress" className="form-label">ที่อยู่</label>
          <textarea className="form-control" id="newAddress" name="newAddress" value={formData.newAddress} onChange={handleInputChange} />
        </div>
        <div className="mb-3">
          <label htmlFor="newCommonMoney" className="form-label">เงินส่วนกลาง</label>
          <input type="number" className="form-control" id="newCommonMoney" name="newCommonMoney" value={formData.newCommonMoney} onChange={handleInputChange} />
        </div>
        <button type="submit" className="btn btn-primary">บันทึก</button>
      </form>
    </div>
  );
}

export default ProfileEdit;
